import React from "react";
import { useState } from "react";
import "./App.css";
//import Map from "./components/Map";
import NavBar from "./components/NavBar";
import Header from "./components/Header";
// import FunctionClickTest0 from './components/FunctionClickTest0'
// import Test from './components/Test'
import MarkerClick from "./components/MarkerClick";
// import ButtonClickTest1 from './components/ButtonClickTest1';
import Footer from "./components/Footer";
import Timeline from "./components/Timeline";
import { GoogleMap, withScriptjs, withGoogleMap } from "react-google-maps";

function Map() {
  return (
    <GoogleMap
      defaultZoom={12}
      defaultCenter={{ lat: 43.469761, lng: -80.538811 }}
    />
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

function App() {
  return (
    <div className="page-container">
      <div className="content-wrap">
        <Header />
        <React.Fragment>
          <div>
            <NavBar />
          </div>
          <MarkerClick />
          {/* <FunctionClickTest0 /> */}
          {/* <ButtonClickTest1 /> */}
          {/* <Test /> */}
          <div style={{ width: "60vw", height: "80vh" }}>
            <WrappedMap
              googleMapURL={
                "https://maps.googleapis.com/maps/api/js?key=AIzaSyCkyLDPGklh0Tvc005p3q_HgCn3KYyidR0&v=3.exp&libraries=geometry,drawing,places"
              }
              loadingElement={<div style={{ height: "100%" }} />}
              containerElement={
                <div style={{ width: "60vw", height: "500px" }} />
              }
              mapElement={<div style={{ height: "100%" }} />}
            />
          </div>
        </React.Fragment>
        <Timeline />
      </div>
      <Footer />
    </div>
  );
}

export default App;
